const code_dummy = `
library ieee;
use ieee.std_logic_1164.all;
use ieee.numeric_std.all;
entity test_entity_name is
generic (
    a : integer;
    b : unsigned;
    c : signed;
    d : std_logic;
    e : std_logic_vector;
    f : std_logic_vector(5 downto 0)
  );
port(
  g : in std_logic;
  h : out std_logic;
  i : inout std_logic
);
end test_entity_name;  
architecture e_arch of test_entity_name is
begin 
end e_arch;
`;
const expected = 'test_entity_name';
const current = await hdl_utils.get_toplevel(code_dummy, general_1.HDL_LANG.VHDL);
(0, assert_1.equal)(current, expected);

const code_dummy = `
module test_entity_name2 
    #(
        parameter a=8,
        parameter b=9,
        parameter c=10, d=11
    )
    (
        input e,
        output f,
        input reg g,
        input wire h,
        input reg [7:0] i, j,
        input wire [9:0] k,
        output wire [9:0] l
    );  

    function [7:0] sum;  
        input [7:0] a, b;  
        begin  
            sum = a + b;  
        end  
    endfunction

    wire m;
    wire n, p;
    reg [1:0] q;

    localparam r = 2;

    always @(posedge a) begin : label_0
    end

    always_comb begin
    end

    always_ff begin : label_1
    end

    always_latch begin
    end

    test_entity_name 
    #(
      .a(a ),
      .b(b ),
      .c(c ),
      .d (d )
    )
    test_entity_name_dut (
      .e (e ),
      .f (f ),
      .g (g ),
      .h (h ),
      .i (i ),
      .j (j ),
      .k (k ),
      .l  ( l)
    );

endmodule
`;
const expected = 'test_entity_name2';
const current = await hdl_utils.get_toplevel(code_dummy, general_1.HDL_LANG.VERILOG);
(0, assert_1.equal)(current, expected);

